import React from 'react';
import './Navbar.css';
import logo from '../../Images/logo.svg';
import { Link, BrowserRouter as Router } from 'react-router-dom';
import { House } from 'react-bootstrap-icons';
import {JournalText} from 'react-bootstrap-icons';

export default function Navbar() {
    return (
        <div className="Sidemenu">
            <div style={{height: '60px',width: '100%'}}>
                <img src={logo} alt="SPP Lab" id="logoImg"></img>
                <div id="imgTitle">SPP Lab</div>
            </div>
            <div style={{height: 'calc(90vh - 100px)',width: '100%',marginTop: '50px'}}>
            <Router>
            <div className='links'>
                <div><Link to='/'>Home</Link><House color="white" size={25}/></div>
                <div><Link to='/what-we-do'>What We Do</Link><JournalText color="white" size={25}/></div>
                {/* <div><Link to='/who-we-are'>Who We Are</Link></div> */}
                <div><Link to='/members'>Members</Link></div>
                <div><Link to='/publications'>Publications</Link></div>
                <div><Link to='/labtour'>Labtour</Link></div>
                <div><Link to='/funstaffs'>Funstaffs</Link></div>
                <div><Link to='/contacts'>Contacts</Link></div>
                <div><Link to='/gallery'>Gallery</Link></div>
            </div>
            </Router>
            </div>
        </div>
    )
}
